import React from "react";
import "./styles.css"; // Ensure this path is correct

function Home() {
  return (
    <div className="home">
      <h1>Welcome to BMW Cars</h1>
      {/* Use process.env.PUBLIC_URL to refer to the public folder */}
      <img
        src={`${process.env.PUBLIC_URL}/54e21663-f198-4c7f-8379-98444080342f.webp`}
        alt="BMW 5 Series"
        style={{ maxWidth: "100%", height: "auto" }}
      />
    </div>
  );
}

export default Home;
